void Port_Init(){
	int wait=5;
	SYSCTL_RCGCGPIO_R |= 0X02;
	while(wait!=0){wait--;}
	
	//GPIO_PORTF_PUR_R = 0x11;//POSITIVE LOGIC
	GPIO_PORTB_DEN_R |= 0X0F;
	GPIO_PORTB_DIR_R &= ~0X0F;
	GPIO_PORTB_DATA_R &= 0XE0; //clear pins 0-4
}


