void Delay100ms(uint32_t count){uint32_t volatile time;
  while(count>0){
    time = 7272;  // 0.1sec at 80 MHz	//ADD 40 FOR DELAY 100MS, RIGHT NOW AT ~1MS
    while(time){
	  	time--;
    }
    count--;
  }
}




